red=1,isRaid=1,lore="The Battle of Mount Hyjal was the final bloody conflict that concluded the Third War. The battle was the culmination of years of fighting between the various mortal forces of Azeroth and the demonic and undead armies of the Burning Legion, and saw the demons' invasion end in decisive failure.\n\nSpecifically, the event took place as part of the invasion of Kalimdor phase of the war, where Archimonde struck directly at the World Tree Nordrassil on Mount Hyjal as part of his endgame. The battle began when a mortal coalition of night elves, Alliance, and New Horde elements arrayed themselves before the World Tree to halt Archimonde's advance. Though they were unable to stand against the Legion indefinitely, they aimed to buy time for Malfurion Stormrage to prepare a proper defense.",lvl=68,mapID=329,sins={"The Battle for Mount Hyjal"},u=19,["zone-text-areaID"]=3606,g={n(-1000004,{u=19,g={(function(t) return handlers.EXALTED_REP_OnInit(t, 990); end)(ach(959,{maps={75},u=19}))}}),n(-1000020,{u=19,g={faction(990,{maps={75},u=19})}}),n(-1000031,{u=19,g={q(10947,{coords={{58,48.2,1948}},qgs={21700},sourceQuests={10946},u=19,g={qo(1,{providers={{"i",32459}},u=19})}}),q(11105,{cost={{"i",29301,1},{"g",750000}},maps={75},minReputation={990,42000},qgs={19935},repeatable=1,sourceQuests={10472,10473,10474,10475},u=19,g={i(29297,{u=19}),i(29309,{u=19}),i(29305,{u=19})}}),q(10474,{altQuests={10472,10473,10475},maps={75},minReputation={990,42000},qgs={19935,19936},sourceQuests={10470},u=19,g={qo(1,{providers={{"i",29300}},u=19}),i(29301,{u=19})}}),q(10470,{altQuests={10468,10469,10471},maps={75},minReputation={990,21000},qgs={19935,19936},sourceQuests={10466},u=19,g={qo(1,{providers={{"i",29299}},u=19}),i(29300,{u=19})}}),q(10462,{altQuests={10460,10461,10463},maps={75},minReputation={990,3000},qgs={19935,19936},sourceQuests={13432},u=19,g={i(29298,{u=19})}}),q(10466,{altQuests={10464,10465,10467},maps={75},minReputation={990,9000},qgs={19935,19936},sourceQuests