m(1414,{icon="Interface\\Icons\\achievement_zone_kalimdor_01",lore="Kalimdor is home to the night elves, orcs, tauren, trolls, and draenei. Other races present include the ogres, centaur, naga, demons, and other, more minor races.",maps={1464},g={n(-1000004,{ach(43,{sym={{"meta_achievement",845,852,860,861,844,848,728,850,853,849,855,736,750,856,4996,847,851,842,750,846,854,857}}}),ach(1678,{sym={{"meta_achievement",4925,4976,4926,4933,4928,4927,4930,4929,4978,4931,4932,4979,4934,4937,4981,4936,4980,4935,4938,4939,4940}}})}),m(1457,{icon="Interface\\Icons\\Inv_misc_tournaments_symbol_nightelf",isRaid=1,lore="The atmosphere inside the city is quiet and tranquil. It does not have the feeling of confinement that one would feel in Stormwind or Ironforge, where the buildings are grouped close together. Darnassus is open to the sky, and the graceful bridges spanning the lake around which it is built set the buildings wide apart. The elegant bridges, beautiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history.",g={n(-1000004,{ach(5848,{awp=40200,r=2,requireSkill=356}),ach(5842,{awp=40200,r=2,requireSkill=185})}),n(-1000020,{faction(69,{icon="Interface\\Icons\\Achievement_Character_Nightelf_Female",r=2,g={crit(5328,{achID=2760,awp=30001,u=31})}})}),n(-1000021,{fp(457,{awp=40001