s empty when first entered - however, it is among the most dangerous places in Azeroth. It was hotly contested between the forces of Ragnaros and his Dark Iron servants on one side and the black dragon Nefarian and his orc minions on the other. This is one of the most important areas in World of Warcraft lore.",lvl=40,maps={34,35},g={n(-1000032,{n(9026,{coords={{36.2,36.2,35},{40.6,37.8,35},{37,28.2,35}},g={i(14486,{f=200,spellID=18422})}}),n(9046,{description="This mob used to simply be rare and have a limited loot table. He was later repurposed for use with the BWL Attunement Quest Chain. The two items listed below were never available in WoW Classic.",g={s(4813,13254,{awp=100107,u=2}),s(4809,13248,{awp=100107,u=2}),i(18987,{u=2})}}),n(8924,{coords={{37.8,61.3,35},{47.6,62,35}},g={i(19259,{u=13}),s(4194,11603)}})})}}),m(1419,{icon="Interface\\Icons\\achievement_zone_blastedlands_01",lore="The Blasted Lands bear that name for a reason: they were twisted by the magic that brought the Dark Portal into being, spewing the rampaging Horde into Azeroth.\n\nThis wasted desert of red clay is home to the original Dark Portal. The portal still stands, and leads to Outland — the remains of the orcs' sundered homeworld, Draenor. Nethergarde Keep, a Stormwind fortress of dour mages and paladins, keeps watch over the portal and the demons and ogres that would abuse its power.\n\nNow, the wretched land hosts few inhabitants and no significant settlements. Magic that leaked through the Dark Portal warped the Blasted Lands, leaving an infertile desert landscape. Hardy desert species like Basilisks, Scorpions and Hyenas have since colonized the area. The red rocks of the region do not come by their color naturally. The original tan color was transmuted into the unearthly crimson by searing heat and chaotic energies when the Dark Portal was destroyed.",g={n(-1000004,{ach(4909,{awp=40003,g={crit(1,{awp=30001,sourceQuests={25701,26171}}),crit(2,{awp=30001,sourceQuests={25720,26187}}),c