lava dot the landscape, as well as charred earth and burning ruins. The sky is a red hue here, due to sporadic eruptions from Blackrock Mountain. Blackrock Spire, an orc stronghold in the Second War, stands proud and defiant among the mountains. Dark Iron dwarves control the fortress's deeps, though rumor has it that Ragnaros the Fire Lord still broods in the shadows. Black dragons under Nefarion hold the spire's upper levels, and the two groups battle constantly for supremacy. The surrounding countryside is home to Blackrock orcs and Fire-Gut ogres, all brutal castoffs from the Second War. The Molten Span, a massive stone edifice in the north, bridges a river of fire and leads to Khaz Modan.",g={n(-1000004,{ach(775,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate}),ach(4901,{awp=40003,g={crit(1,{awp=30001,sourceQuests={28183,28425}}),crit(2,{awp=30001,sourceQuests={28322,28456}}),crit(3,{awp=30001,sourceQuests={28286,28441}}),crit(4,{awp=30001,sourceQuests={28326,28449}})}})}),n(-1000019,{exp(255,{maphash="225:220:36:109"}),exp(254,{maphash="256:280:173:101"}),exp(2417,{maphash="270:310:589:279"}),exp(252,{maphash="245:265:334:114"}),exp(2421,{maphash="415:315:56:258"}),exp(249,{maphash="220:225:707:168"}),exp(2418,{maphash="294:270:708:311"}),exp(250,{maphash="270:285:513:99"}),exp(2420,{maphash="280:355:722:46"}),exp(253,{maphash="320:270:377:285"})}),n(-1000021,{fp(676,{awp=40001,coords={{46,41.8,1428}},crs={48321}}),fp(70,{coords={{54.2,24.2,1428}},crs={13177},r=1}),fp(675,{awp=40001,coords={{17.6,52.6,1428}},crs={48318}}),fp(71,{coords={{72.2,65.6,1428}},crs={2299},r=2})}),n(-1000031,{q(28316,{awp=40003,coords={{73.5,67.2,1428}},qgs={48306},r=2,sourceQuests={28311,28312,28313}}),q(28448,{awp=40003,coords={{54.7,24.5,1428}},qgs={48565},r=1,sourceQuests={28443,28444,28445}}),q(28318,{awp=40003,coords={{73.6,67.1,1428}},qgs={48307},r=2,sourceQuests={28326}}),q(28451,{awp=40003,coords={{54.6,24.4,1428}},qgs={48569},r=1,sourceQuests={284