 Duskwood and Swamp of Sorrows, evil magic can be felt all through the zone, the trees are all but dead, and very few wildlife and ogres can be found in the zone. Travelers are advised to go through the pass fast, as they might fall to the zone's foreboding magic.\n\nTrivia:\nMedivh, the last Guardian, made Deadwind Pass his final place. The tower of Karazhan to the south served as his bastion until his final days.\n\nThe Karazhan Crypts can be explored by players who kill themselves and traverse the gates as a ghost. The crypt is filled to the brim with disturbing content, the most disturbing being a pool filled with human bodies hanged upside down and roped to chains. This area became known to players as the Upside-Down Sinners.",maps={41,43,44,45,46},g={n(-1000004,{ach(777,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(2697,{maphash="380:365:249:76"}),exp(2562,{maphash="300:245:269:337"}),exp(2561,{maphash="270:270:426:299"})}),n(-1000039,{n(18255,{coords={{47.2,75,1430}},u=17,g={r(38503,{itemID=31401,requireSkill=755,u=17}),r(42620,{awp=20300,itemID=33165,requireSkill=333,u=19}),r(42546,{awp=20200,itemID=33124,requireSkill=165,u=19}),r(42731,{awp=20200,itemID=33205,requireSkill=165,u=19}),r(42736,{itemID=33209,requireSkill=171,rwp=50001,u=19}),i(29187,{u=17})}})}),n(-1000044,{r(20010,{crs={7372},itemID=16246,requireSkill=333})})}}),m(499,{icon="Interface\\Icons\\INV_Misc_EngGizmos_03",lore="The Deeprun Tram is a long, fully enclosed, underground (and partially underwater) set of double tracks upon which rolls two sets of three wagons, all credited to the gnomes' technical engineering. The service is fast and smooth, and is provided free of charge to travelers between the Alliance-aligned cities of Ironforge and Stormwind City.",g={n(-1000031,{q(6661,{lvl=10,qgs={12997},r=2,g={qo(1,{crs={13016},providers={{"i",17117}}})}}),q(6662,{cost={{"i",17118,1}},lvl=10,qgs={12997},r=2,sourceQuests={6661},g={i(17119)}})})}}),m(1426,{icon="Interface\\Icons\\achievement_zone_dunmorogh",lore="Dun Morogh is home to both the gnomes of Gnomeregan and the Ironforge dwarves and is the location of the major city of Ironforge. The Khaz Modan mountains surround Dun Morogh on all sides, making it accessible only by certain passes that are currently watched over by dwarven troops.\n\nThe center of dwarven culture and ingenuity, Dun Morogh holds the capital of Ironforge. The region is snow-swept and forested, with gray, craggy mountains and slinking wolves. Troggs recently overran Gnomeregan, the gnomes' former capital, and drove its citizens to Ironforge. Frostmane trolls menace dwarven patrols. Several villages and towns dot the landscape, and though the trade routes can be perilous, dwarven mountaineers and warriors keep their settlements safe.",maps={29,31,470},g={m(427,{icon="Interface\\Icons\\Achievement_Character_Dwarf_Male",lore="Coldridge Valley is the starting area for young dwarven recruits, and contains the base camp of Anvilmar. It is located in the southwestern corner of Dun Morogh, and is linked to the greater area by Coldridge Pass to the northeast.",maps={28,428},g={sp(921),n(-1000031,{q(170,{coords={{29.6,71.2,1426}},qgs={713},r=2,sourceQuests={179},u=2,g={qo(1,{providers={{"n",707}}}),qo(2,{providers={{"n",724}}}),s(2282,6185,{u=2}),s(643,2172,{u=2}),s(2275,6173,{u=2})}}),q(3361,{coords={{41.8,63.7,427}},lvl=3,qgs={8416},r=2,sourceQuests={24487},g={qo(1,{coords={{20.9,76.1,1426}},providers={{"i",10438}}}),qo(2,{coords={{22.8,79.9,1426}},providers={{"i",16313}}}),qo(3,{coords={{26.3,79.2,1426}},providers={{"i",16314}}})}}),q(24490,{awp=40003,coords={{42.7,62.1,427}},qgs={786},r=2,sourceQuests={218}}),q(24471,{awp=40003,coords={{65.5,41.9,427}},qgs={658},r=2,sourceQuests={24469}}),q(24475,{awp=40003,coords={{60.6,21,427}},qgs={37087},r=2,sourceQuests={24474}}),q(24496,{awp=40003,c={8},coords={{61.4,19.4,427}},qgs={37087},races={3},rwp=70003}),q(1599,{altQuests={1598},c={9},coords={{2