ning site rich with multiple types of ore. The mining work is mainly done by slave labor, which consists for the most part of captured enemies.\n\nEver since the Dark Iron dwarves' capital, Thaurissan, was destroyed by the summoning of Ragnaros, they have searched for a landmass to control for their filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage.",g={n(-1000004,{ach(774,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate}),ach(4910,{awp=40001})}),n(-1000019,{exp(246,{maphash="425:325:250:170"}),exp(1959,{maphash="460:365:422:8"}),exp(1442,{maphash="405:430:85:30"}),exp(1444,{maphash="360:280:247:388"}),exp(1958,{maphash="305:230:545:407"}),exp(1957,{maphash="275:235:77:366"}),exp(247,{maphash="305:220:494:300"})}),n(-1000021,{fp(673,{awp=40001,coords={{41,68.6,1427}},crs={47927}}),fp(74,{coords={{37.8,30.6,1427}},crs={2941},r=2}),fp(75,{coords={{34.8,30.6,1427}},crs={3305},r=1})}),n(-1000030,{prof(165,{n(7868,{coords={{63.6,75.8,1427}},r=2,u=2,g={r(36074,{awp=20005,u=2}),r(36077,{awp=20005,u=2}),r(35590,{awp=20005,requireSkill=10658,u=2}),r(35591,{awp=20005,requireSkill=10658,u=2}),r(35589,{awp=20005,requireSkill=10658,u=2}),r(10658,{u=2}),r(10630,{u=2}),r(10632,{u=2})}})})}),n(-1000031,{q(27962,{awp=40003,coords={{68.4,53.2,1427}},qgs={47267},sourceQuests={27960},g={qo(1,{providers={{"i",10005}}})}}),q(27963,{awp=40003,coords={{68.5,53.3,1427}},qgs={47266},sourceQuests={28512,28581,28582},g={qo(1,{crs={47270},providers={{"i",62807}}}),s(31757,63218,{awp=40003}),s(31756,63217,{awp=40003}),i(63216,{awp=40003})}}),q(27958,{awp=40003,coords={{68.7,53.3,1427}},qgs={47268},sourceQuests={27957},g={qo(1,{crs={5856},providers={{"i",62809}}}),s(31751,63211,{awp=40003}),s(31750,63210,{awp=40003}),s(31749,63