n forest, but they are desperate and their forces thinly stretched. Dalaran sends frequent expeditions into Silverpine to defend these people and study the undead plague and worgen curse — a mysterious affliction that causes its victims to transform into bloodthirsty, lycanthropic worgen when the moon rises.",g={n(-1000004,{ach(769,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate}),ach(4894,{awp=40003,r=1})}),n(-1000019,{exp(226,{maphash="185:165:286:37"}),exp(237,{maphash="180:185:457:144"}),exp(204,{maphash="140:125:391:446"}),exp(229,{maphash="165:185:382:252"}),exp(236,{maphash="220:160:364:359"}),exp(230,{maphash="210:215:379:447"}),exp(238,{maphash="256:160:465:0"}),exp(928,{maphash="180:128:323:128"}),exp(233,{maphash="240:240:494:262"}),exp(231,{maphash="240:180:491:417"}),exp(240,{maphash="175:165:402:65"}),exp(228,{maphash="210:160:352:168"}),exp(927,{maphash="256:220:459:13"}),exp(213,{maphash="160:170:470:261"}),exp(172,{maphash="250:215:593:74"})}),n(-1000021,{fp(645,{awp=40003,coords={{57.8,8.8,1421}},crs={44825},r=1}),fp(681,{awp=40003,coords={{45.8,21.8,1421}},crs={50463},r=1}),fp(654,{awp=40001,coords={{50.8,63.6,1421}},crs={46552},r=1}),fp(10,{coords={{45.4,42.4,1421}},crs={2226},r=1})}),n(-1000031,{q(27577,{awp=40003,coords={{51.8,65,1421}},qgs={45879},r=1,sourceQuests={27547,27548,27550}}),q(530,{coords={{62,43,1458}},lvl=10,qgs={2050},r=1,sourceQuests={441},u=2,g={qo(1,{coords={{46.4,84.6,1421}},crs={2332},providers={{"i",3613}}}),i(3235,{u=2})}}),q(447,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,u=2,g={qo(1,{crs={1778,1797,12432},providers={{"i",3253}}}),qo(2,{crs={1780,1781,12433},providers={{"i",3254}}})}}),q(450,{coords={{48.6,69.4,1458}},lvl=9,qgs={2055},r=1,sourceQuests={447},u=2,g={qo(1,{coords={{43,73.3,1421}},providers={{"i",3255}}})}}),q(451,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,sourceQuests={450},u=2,g={qo(1,{crs={1953,1954},providers={{"i",3256}}}),qo(2,{crs={1955,1956},providers={{"i",3257}}